window.bookSummaryJSON = "<p>His family killed my brother, so I stole his bride....</p> <p>I was there to murder her father, but then I saw <i>her</i> walking down the aisle.</p> <p>She’s been my secret obsession for too long. The sinfully beautiful Calabresi princess.</p> <p>Sloan was the perfect payment for their crimes.</p> <p>Now she’s mine.</p> <p>Mine to claim.</p> <p>Mine to possess.</p> <p>Mine to destroy.</p> <p>Her fiancé is still hunting for us, but his bride might not be so innocent by the time he tracks her down.</p> <p>I’m lining her family up like dominoes. And she’ll be the first to fall.</p> <p>Unless I fall prey to temptation and decide to keep her for myself.</p> <p>Rocco and Sloan’s story is a stand-alone enemies-to-lovers dark romance with a HEA and no cliff-hanger. It contains heat, passion and explosive steamy scenes for listeners who enjoy mature content.</p>"; 
